import React from 'react';
//import {NavLink} from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.css';
import './LeadStatus.css';

const LeadStatus =() => {
    return(
        <div className={'container'}>
            <h2> This is lead  </h2>
            <p>Lead Status</p>
            <div className={'ls-top-section'}>
                <div className={"row"}>
                    <div className={"col"}>
                        <i className="zmdi zmdi-account-circle" style={{color: "bisque", fontSize: "2rem", marginLeft: "40%", marginRight: '-38.5%', display: "inline-block" }}> &nbsp; Lead Status -</i>
                            <text style={{ display:"flex", marginLeft:"104%", marginTop:"-3vh", color: "darkblue" , fontSize: "1rem" }}> Need to call </text>  {/*add status dynamically {status} from backend*/}

                    </div>
                    <div className={"col"}>
                        <button className={'topsection-btn'} style={{backgroundColor: "coral", borderRadius: "8%" }}> Update </button>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default LeadStatus;
